import {takeEvery} from 'redux-saga/effects';
import boutiqueActionType from './types.boutique';


function* fetchCollectionAsync(){
   yield console.log("I'm fired");
}

export function* fetchCollectionsStart(){
 yield takeEvery(boutiqueActionType.FETCH_COLLECTION_START, fetchCollectionAsync)
}
